import React, { useState } from "react";
import {
  Navbar,
  Typography,
  IconButton,
  Button,
  Input,
} from "@material-tailwind/react";
import { BuildingStorefrontIcon, Cog6ToothIcon, ShoppingBagIcon } from "@heroicons/react/24/solid";
import axios from "axios"; // Import axios

export function NavbarDark() {
  const [searchQuery, setSearchQuery] = useState("");

  const handleSearch = async () => {
    try {
      const response = await axios.get(`/scrape?query=${searchQuery}`);
      if (response.data.message) {
        alert(response.data.message);
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <Navbar
      variant="gradient"
      color="blue-gray"
      className="mt-3 mx-auto max-w-screen-xl from-customSky to-customLight px-4 py-3"
    >
      {/* ... (your existing JSX) */}
      <div className="relative flex w-full gap-2 md:w-max">
        <Input
          type="search"
          color="white"
          label="Type here..."
          className="pr-20"
          containerProps={{
            className: "min-w-[288px]",
          }}
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <Button
          size="sm"
          color="white"
          className="!absolute right-1 top-1 rounded bg-gradient-to-r from-customBlue to-customSky hover:from-customSky hover:to-customBlue transition-all duration-300 "
          onClick={handleSearch} // Call the handleSearch function on button click
        >
          Search
        </Button>
      </div>
    </Navbar>
  );
}
